import React from 'react';
import Cell from './Cell.js'

class FluenceMap extends React.Component {
    render() {
        return (
            <div>
            <Cell number={this.props.row[0]} />
            <Cell number={this.props.row[1]} />
            <Cell number={this.props.row[2]} />
            <Cell number={this.props.row[3]} />
            <Cell number={this.props.row[4]} />
            <Cell number={this.props.row[5]} />
            <Cell number={this.props.row[6]} />
            <Cell number={this.props.row[7]} />
            </div>
        );

    }
}

export default FluenceMap;
